import React from 'react';
import Views from './Components/Views'
import './App.css';

function App() {
  return (
  <div>
          <div className="App">
          <div className="Center-Container">
          <iframe referrerpolicy="no-referrer" sandbox="allow-same-origin" src="https://www.youtube.com" height="500px" width="500px"></iframe>
          <Views/>
          </div>
          </div>
  </div>  

  );
}

export default App;
